import "./ExpensesList.css"
import ExpenseItem from "./ExpenseItem";

function ExpensesList(props) {

    const expansesObjet = props.data

    return (

        <div className="expenses">
            {expansesObjet.map(({exdate, extitle, exprice}) => {
                return (<div key={exdate}>
                        <ExpenseItem date={new Date(2012, 12, 12)} title={extitle} price={exprice}/>
                    </div>
                );
            })}
        </div>);
}
    export default ExpensesList
